module adv_fsm(
input clk,
input reset,
input x,
output z ); 

reg [1:0] present_state, next_state;
parameter IDLE=0, S1=1, S10=2, S101=3;

// Output logic
assign z = (present_state == S101);

// State register
always @(posedge clk or posedge reset) begin
    if (reset)
        present_state <= IDLE;
    else
        present_state <= next_state;
end

// Next state logic
always @(*) begin
    case (present_state)
        IDLE: begin
            if (x == 1)
                next_state = S1;
            else
                next_state = IDLE;
        end

        S1: begin
            if (x == 0)
                next_state = S10;
            else
                next_state = IDLE;
        end

        S10: begin
            if (x == 1)
                next_state = S101;
            else
                next_state = IDLE;
        end

        S101: begin
            next_state = IDLE;
        end

        default: next_state = IDLE;
    endcase
end

endmodule

