module simple_fsm(input clk, input reset, input in, output out);
reg present_state, next_state;

// State register
always @(posedge clk or posedge reset) begin
    if (reset)
        present_state <= 1'b0;
    else
        present_state <= next_state;
end

// Next state logic
always @(*) begin
    case (present_state)
        1'b0: begin
            if (in == 1'b0)
                next_state = 1'b1;
            else
                next_state = 1'b0;
        end
        1'b1: begin
            if (in == 1'b0)
                next_state = 1'b0;
            else
                next_state = 1'b1;
        end
    endcase
end

// Output logic (Moore machine - output depends only on present state)
assign out = (present_state == 1'b0);

endmodule

